import React from 'react';
import { Provider } from 'react-redux';
import store from './store';
import NavBar from './components/NavBar/NavBar';

const App = () => {
  return (
    <Provider store={store}>
      <div>
        <NavBar />
        
      </div>
    </Provider>
  );
};

export default App;
